export const getStudents = (): Promise<Student[]> => {
  return new Promise((resolve) => {

    setTimeout(() => {
      resolve([...mockStudents]);
    }, 800);
  });
};


export const addStudent = (student: Omit<Student, 'id'>): Promise<Student> => {
  return new Promise((resolve) => {
    
    setTimeout(() => {
      const newStudent = {
        ...student,
        id: Math.random().toString(36).substring(2, 9),
      };
      
     
      resolve(newStudent);
    }, 600);
  });
};

export const getCourses = (): Promise<string[]> => {
  return new Promise((resolve) => {
    
    const courses = Array.from(new Set(mockStudents.map(student => student.course)));
    
    
    setTimeout(() => {
      resolve(courses);
    }, 300);
  });
};